import React, { Component } from 'react';
import Immutable from 'immutable';

const { Map } = Immutable;

const data = Map({
  a: 1,
  b: 2
});
console.log('Map 생성: ', data);

const data1 = Map({
  a: 1,
  b: 2,
  c: Map({
    d: 3,
    e: 4,
    f: 5
  })
});
console.log('Map 계층구조 생성: ', data1);

class App extends Component {
  render() {
    return (
      <div className="App">
        immtable concept console을 통해 익히기
      </div>
    );
  }
}

export default App;
